                        </Card.Text>
                        <Button className='col-lg-12' variant="primary" style={{background:"rgb(67,185,127)", border:"rgb(67,185,127)",justifySelf:'center'}}>Get Webcam Acess</Button>
                    </Card.Body>
                </Card>
            </div>

        </>
    )
}

export default Sign_img
